void c_debugriomdetialpage::SetDIOState(int DIO_ID ,int DIO_state)
{
    if(DIO_state==1)
    {

        ((CLabel *)GetDlgItem(DIO_ID))->SetCtrlText("1");
    }
    else if(DIO_state==0)
    {
        ((CLabel *)GetDlgItem(DIO_ID))->SetCtrlBKColor(Qt::red);
         ((CLabel *)GetDlgItem(DIO_ID))->SetCtrlText("0");
         ((CLabel *)GetDlgItem(DIO_ID))->SetTxtColor(Qt::white);

    }
    else if(DIO_state==2)
    {
        ((CLabel *)GetDlgItem(DIO_ID))->SetCtrlText("--");
        ((CLabel *)GetDlgItem(DIO_ID))->SetCtrlBKColor(Qt::black);

    }

}
